tables.table_schema:
CREATE TABLE SupplierLeadTimes (
    supplier_id INT PRIMARY KEY,
    lead_time INT,
    report_date DATE
);

CREATE TABLE DeliveryPerformance (
    delivery_id INT PRIMARY KEY,
    supplier_id INT,
    delivery_date DATE,
    status VARCHAR(50)
);

CREATE TABLE supplier_lead_times (
    supplier_id INT NOT NULL,
    lead_time INT NOT NULL,
    PRIMARY KEY (supplier_id)
);

CREATE TABLE delivery_performance (
    delivery_id INT NOT NULL,
    delivery_time TIMESTAMP NOT NULL,
    delivery_status VARCHAR(50) NOT NULL,
    PRIMARY KEY (delivery_id)
);

CREATE TABLE supplier_reports (
	supplier_id INT PRIMARY KEY,
	supplier_name VARCHAR(255) NOT NULL,
	lead_time INT NOT NULL,
	delivery_performance FLOAT NOT NULL
);

CREATE TABLE delivery_reports (
	report_id INT PRIMARY KEY,
	supplier_id INT,
	delivery_date DATE NOT NULL,
	delivery_time TIMESTAMP NOT NULL
);

CREATE TABLE vendor_management (
	vendor_id INT PRIMARY KEY,
	vendor_name VARCHAR(255) NOT NULL,
	contact_email VARCHAR(255)
);

CREATE TABLE performance_metrics (
	metric_id INT PRIMARY KEY,
	supplier_id INT,
	performance_rating INT
);

CREATE TABLE lead_time_metrics (
	metric_id INT PRIMARY KEY,
	supplier_id INT,
	lead_time_days INT
);
